import * as React from 'react';
import styled from 'styled-components';
import {font} from '../../styles/Common';
import {theme} from '../../styles/Theme';
import {Icon} from '../icon/Icon';

type QuestionItemPropsType = {
    question:string
    answer:string
};
export const QuestionItem = (props: QuestionItemPropsType) => {
    return (
        <StyledQuestionItem>
            <Title>{props.question}</Title>
            <Button type={'button'} onClick={()=>{}}><Icon iconId={'plus'} width={'30px'} heigth={'30px'}/></Button>
            <Text>{props.answer}</Text>
        </StyledQuestionItem>
    );
};

const StyledQuestionItem = styled.div`
    display: flex;
    flex-wrap: wrap;
`;
const Title = styled.h4`
    width: 90%;
    ${font({family: '"Montserrat", sans-serif', weight: 500, Fmax: 23, Fmin: 15, color: `${theme.colors.fontColor}`})};
    padding-bottom: 20px;
`;
const Button = styled.button`
    width: 10%;
    background:none;
    font-size: 40px;
    border: none;
`;
const Text = styled.p`
    width: 100%;
`;
